import axios from 'axios';
import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'


class UsuariosList extends Component {

    render() {
        return (
            <table class="table" style={{ marginTop: 15, marginLeft: 15 }}>
                {this.state.usuarios.map(usuario =>
                    <tr key={usuario.dni}>
                        <input>{usuario.nombre}</input>
                        <input>{usuario.apellido}</input>
                        <input>{usuario.dni}</input>
                        <input>{usuario.centroSalud}</input>
                        <input>{usuario.rol}</input>
                        <td>
                            <button class="btn btn-success" id={usuario.dni} style={{ marginRight: 10 }}>Aceptar</button>
                        </td>
                    </tr>
                )}
            </table>
        );
    }
}

export default UsuariosList
